  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report is to update
  the progress of the bald eagle migration and movements study begun during July 1982.
  The study was initiated to: (1) determine and compare seasonal movement patterns
  of sub-adult and adult bald eagles on Kodiak Island, and (2) to identify possible
  emigration and immigration patterns between the Kodiak population of bald eagles
  and other Alaskan or North Pacific bald eagle populations.\",\n\t\"license_title\":
